    <StyledApp className="App">
      <Nav>Death's Door</Nav>
        {/* <PlayerInfo>Player</PlayerInfo> */}
      <ChatLog>
        <div className="chat-message">
          <img />
          <div className="avatar">Me</div>
          <div className="message">Message</div>
